                    path.lineTo(center.x + halfWidth, center.y + halfHeight);
                    ctx.stroke(path);
                    path = new Path2D();
                    path.moveTo(center.x - halfWidth, center.y + halfHeight);
                    path.lineTo(center.x + halfWidth, center.y - halfHeight);
